func findNumberIn2DArray(matrix [][]int, target int) bool {
    if len(matrix) < 1 {
        return false
    }
    m, n := len(matrix), len(matrix[0])
    for i, j := 0, n - 1; i < m && j >= 0; {
        if matrix[i][j] == target {
            return true
        }
        if matrix[i][j] < target {
            i++
        } else {
            j--
        }
    }
    return false
}
```

