func replaceSpace(s string) string {
    if len(s) < 1 {
        return s
    }
    result := make([]byte, 0)
    for i := range s {
        if s[i] == ' ' {
            result = append(result, '%', '2', '0')
            i++
        } else {
            result = append(result, s[i])
        }
    }
    return string(result)
}
